import React from 'react'
import Layout from '../Components/Layout'

const Home = () => {
    return (
        <>
            <div className='r1'>
                <input
                    placeholder='Search for Dishes or Restaurant'
                    style={{
                        textAlign: 'center',
                        width: '50%',
                        height: '30px',
                    }}
                ></input>
                <button
                    type='search'
                    span='left'
                    style={{
                        width: '30px',
                        height: '30px',
                    }}
                ></button>
            </div>
            <div className='r2'></div>
        </>
    )
}

export default Home
